                        }
                        // document.getElementById("dfretgreerff").innerHTML = pId;
                        //  alert('hjj');
                        // alert(advancegames);
                        var val = 3;
                        //document.cookie = "tickpriceids = " + tickpriceids;
                        $.ajax({
                            headers: {
                                'X-CSRF-TOKEN': $('meta[name="csrf-token"]').attr('content')
                            },
                            type: "POST",
                            url: "{{URL('/')}}/buytickets",
                            data: {
                                lttrynumsss: pId,
                                lttrynumsqntss: sId,
                                tickpriceidss: tickpriceids,
                                useridddss: useriddds,
                                advancegamess: advancegames
                            },
                            success: function(data) {
                               console.log(data);
                                if (data.trim() == "") {
                                    document.getElementById("buybutton").innerHTML =
                                        '<i class="fa fa-spinner fa-pulse font-size-24" style="color:red"></i>';
                                } else {
                                    var id_numbers = JSON.parse(data);
