    function calcuqac(inid, divaue, elementf) {
        // alert(inid);
        var tickpriceids = document.getElementById("tickpriceid").value;
        var inidvalue = document.getElementById(inid).value;
        var inidplaceholder;
        var dzvaue = document.getElementById('zindexvalue').value;
        var allindxv = document.getElementById('allindx').value;
        var evengindxval = document.getElementById('evengindx').value;
        var oddgindxval = document.getElementById('oddgindx').value;
        var tickseriesabasev = document.getElementById("tickseriesabasev").value;
        var tickseriesbbasev = document.getElementById("tickseriesbbasev").value;
        var tickseriescbasev = document.getElementById("tickseriescbasev").value;
        // alert(elementf.keyCode);
        if ((elementf.keyCode == 38) || (elementf.keyCode == 37) || (elementf.keyCode == 40) || (elementf.keyCode ==
                39)) {
            if (elementf.keyCode == 38) {
                // alert('hgh');

                y = divaue;
                x = 9;


                elementff = document.getElementById('ticknum' + y + x);

                elementff.focus();
            }

            if (elementf.keyCode == 40) {
                // alert('hgh');

                y = divaue;
                x = 0;


                elementff = document.getElementById('ticknum' + y + x);

                elementff.focus();
            }

            if (elementf.keyCode == 37) {
                // alert('hgh');

                y = divaue - 1;


                if (y == 0) {

                    x = 9;
                    y = 10;
                    elementff = document.getElementById('ticknum' + y + x);

                } else {
                    elementff = document.getElementById('qntcol' + y);
                }


                elementff.focus();
            }
            if (elementf.keyCode == 39) {
                // alert('hgh');
                y = divaue + 1;

                if (y == 11) {

                    y = 1;
                    x = 0;
                    elementff = document.getElementById('qntrow' + x);

                } else {
                    elementff = document.getElementById('qntcol' + y);
                }

                elementff.focus();
            }
        } else {
            if (elementf.keyCode == 46) {

                inidvalue = "";
                document.getElementById(inid).value = inidvalue;
            }
            //  alert(divaue);
            if (inidvalue == "") {
                inidvalue = 0;
            }

            if (allindxv == 0) {
